import React, { useEffect } from "react";
import { useFetch } from "../../hooks.js/useFetch";
import Styles from "./Admin.module.scss";
import { Link, Route, Routes } from "react-router-dom";
import { LoadingSpinner } from "../../elements/loadingSpinner/loadingSpinner";

const Admin = () => {
  const { loading, response, error } = useFetch({
    url: "http://127.0.0.1:4000/api/v1/forms/",
    method: "get",
  });

  return (
    <div className={Styles.container}>
      <Link to="/"></Link>
      {loading ? (
        <div className={Styles.spinnerBox}>
          <LoadingSpinner />
        </div>
      ) : (
        response.forms.photoForms.map((form) => (
          <div className={Styles.formBox} key={form.id}>
            <div className={Styles.imagesBox}>
              {form.file_names.map((photo, index) => (
                <img
                  key={index}
                  src={`${process.env.REACT_APP_FILES_URL}/${photo}`}
                  alt=""
                />
              ))}
            </div>
            <p>
              Имя: <span>{form.name}</span>
            </p>
            <p>
              Город: <span>{form.city}</span>
            </p>
            <p>
              Номер телефона: <span>{form.phone_number}</span>
            </p>
            <p>
              Коментарий: <span>{form.comment}</span>
            </p>
          </div>
        ))
      )}
      <Routes>
        <Route path="/" element={<div>fwf</div>} />
        <Route path="b" element={<p>b</p>} />
      </Routes>
    </div>
  );
};

export default Admin;
